import Iframe from 'react-iframe';
import './App.css';

function NetdataElement() {
  var netdata_iframe = (<Iframe url="https://netdata.tylerharrison.dev/"
  width="99%"
  height="800px"
  id="netdata"
  className="netdata"
  display="initial"
  position="relative"
  frameBorder="0"/>)
  netdata_iframe.contentWindow.document.getElementById("");
  return netdata_iframe;
}

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Ironsight - Systems Analysis and Design
        </p>
      </header>
      <iframe src="https://netdata.tylerharrison.dev/"></iframe>
    {/* <NetdataElement /> */}
    </div>
  );
}


export default App;
